import React from 'react';
import Navigation from '../components/Navigation';
import HeroSection from '../components/HeroSection';
import FeatureHighlight from '../components/FeatureHighlight';
import ServiceOverview from '../components/ServiceOverview';
import Testimonials from '../components/Testimonials';
import FooterCTA from '../components/FooterCTA';
import CTAButton from '../components/CTAButton';

import SEO from '../components/SEO'; // New component for SEO meta tags

const LandingPage = () => {
  return (
    <>
      <SEO title="TechSaaS Vision - Empowering Your Business" />
      <Navigation />
      <HeroSection
        title="Empower Your Business with TechSaaS Vision"
        subtitle="Innovative, Scalable, and Secure Solutions to Drive Your Success"
        backgroundVideo="/assets/videos/logovideo.mp4" // Use the video for impact
        ctaButton={<CTAButton text="Get Started" link="/signup" />}
      />
      <FeatureHighlight />
      <ServiceOverview />
      <Testimonials />
      <FooterCTA text="Ready to take your business to the next level?" />
    </>
  );
};

export default LandingPage;
